import React from 'react';
import '../hubungi_kami/hubungikami.css'; 


function hubungikami() {
    return (
      <>
        <section className="bg-light pattern-overlay-1-dark">
		<div className="container">
			<div className="col-md-12 col-lg-9 mx-auto p-4 p-sm-5 position-relative">
				<div className="text-center px-0 px-sm-5">
					<h2>HUBUNGI KAMI</h2>
					<p className="mb-3 ">Untuk Melakukan Pemesanan, Konsultasi & Mendapatkan Informasi Lainnya</p>


          <div className="fusion-button-wrapper fusion-aligncenter">
            <a className="fusion-button button-flat fusion-button-square button-large button-default button-10" target="_self" href="/kontak-kami/">
              <span className="fusion-button-text">Hubungi Kami</span></a></div>


				</div>
			</div>
		</div>
	</section>

      </>
   
    )
}

export default hubungikami;
